import { Row, Col, Container, Button, Modal } from "react-bootstrap";

const SelectedAttendance = () => {
  return (
    <>
      <Container className="selected-attendance text-center" fluid>
        <Row>
          <Col>Test</Col>
        </Row>
      </Container>
    </>
  );
};

export default SelectAttendance;
